content=More especially this attractive unreality fell upon it about nightfall, when the extravagant roofs were dark against the afterglow and the whole insane village seemed as separate as a drifting cloud. This again was more strongly true of the many nights of local festivity, when the little gardens were often illuminated, and the big Chinese lanterns glowed in the dwarfish trees like some fierce and monstrous fruit. And this was strongest of all on one particular evening, still vaguely remembered in the locality, of which the auburn-haired poet was the hero. It was not by any means the only evening of which he was the hero. On many nights those passing by his little back garden might hear his high, didactic voice laying down the law to men and particularly to women.

